import React from "react";
import { withRouter } from "react-router";

class EventDetails extends React.Component {

    // constructor (props){

    //     super(props);
    //     console.table(props);

    // }

    constructor (props){

        super(props);
        this.state = {
          event_uuid: [],
        }

    }

    componentDidMount() {

        this.setState({
            event_uuid: this.props.match.params.slug
        });

    }

    render() {

        return (
            <div>
                <h1>[event details] - {this.state.event_uuid}</h1>
            </div>
        )
    }
}

export default EventDetails
